    def time_to_seconds(time):
        time = time.split(':')
        hour, minute = time
        sec = 60 * 60 * int(hour) + 60 * int(minute)
        return sec

    # convert time to minutes
    def time_to_minutes(time):
        time = time.split(':')
        hour, minute = time
        sec = 60 * int(hour) + int(minute)
        return sec

