    L = len(stdin)
    # find the longest palindrome, either whole word or substring
    def longestPalindrome(s, l, r):
        # check if left is within left window
        while l >= 0 and r < L and s[l] == s[r]:
            l -= 1
            r += 1
        # print('l, r', l, r)
        if r - l > 1:
            return s[l + 1:r]
        return ''

    # initialize a dictionary with a key for each character
    dict_char = {chr(i): 1 for i in range(97, 123)}
    # iterate over each character
    for i in range(L):
        # determine if the character is a substring of length 1, and is not already a substring of a palindrome
        if dict_char[stdin[i]] == 1 and longestPalindrome(stdin, i, i) == '':
            return str(i + 1)
        # determine if the character is a substring of length 2, and is not already a substring of a palindrome
        if dict_char[stdin[i]] == 2 and longestPalindrome(stdin, i, i + 1) == '':
            return str(i + 2)
        # if the character is already a substring of length 1, add 1 to it's count
        dict_char[stdin[i]] += 1
    return str(0)

