1. Find the gcd of $a$ and $b$
2. Divide the gcd by the smaller one
3. Multiply the two numbers together

If we pick the gcd of $a$ and $b$ and divide it by the smaller one, then we get $gcd(a,b) = gcd(a,b)/min(a,b)$. We then multiply the two numbers together to get $gcd(a,b) = gcd(a,b)*(a+b)$.

