class Frame:
    # constructor
    def __init__(self):
        self.res = -1

    # find the frame
    def find_frame(self, matrix, matrix2d, n, m, matrix):
        # check if the frame already exists
        if self.res!= -1:
            return

        # check if it is a square
        if n!= m:
            return

        # find the size
        size = int(math.sqrt(n))

        # check if the size is even
        if size % 2 == 0:
            return

        # find the color of each pixel
        self.color = []
        for i in range(n):
            for j in range(m):
                if matrix2d[i][j] == "w":
                    self.color.append(matrix[i][j])

        # check the size
        if size!= len(self.color):
            return

        # check if there are all white pixels
        if len(self.color)!= n:
            return

        # check if the color is the same
        for i in range(n):
            if matrix[i][0]!= self.color[i]:
                return

        # check if the color is the same
        for i in range(n):
            if matrix[0][i]!= self.color[i]:
                return

        # check if the color is the same
        for i in range(n):
            if matrix[i][n - 1]!= self.color[i]:
                return

        # check if the color is the same
        for i in range(n):
            if matrix[n - 1][i]!= self.color[i]:
                return

        # check if the color is the same
        for i in range(n):
            if matrix[n - 1][n - 1]!= self.color[i]:
                return

        # check if the color is the same
        for i in range(n):
            if matrix[0][0]!= self.color[i]:
                return

        # the size is right
        self.res = size

    # get the results
    def get_res(self):
        return self.res

