class Solution:
    def solve(self, N: int, S: List[int]) -> str:
        size = [0] * N
        for i in range(N):
            size[i] = S[i]

        def increase(index):
            size[index] += size[index+1]

        def decrease(index):
            size[index] -= size[index+1]

        def get_total_size():
            return sum(size)

        for i in range(N-1):
            if size[i] < size[i+1]:
                increase(i)
            else:
                decrease(i)

        return get_total_size()

